import gsap from 'gsap';

class Test extends React.Component {
    constructor(props){
        super(props);
        // reference to the DOM node
        this.myElement = null;
        // reference to the animation
        
      }
    componentDidMount() {
        gsap.from(this.myElement, {dulay: 2000, x: -100, opacity: 0})
    }

    render() {
        return(
            <div ref={div => this.myElement = div}>

                <style jsx>
                    {
                        `
                        div {
                            width: 200px;
                            height: 200px;
                            background: red;
                        }
                        
                        `
                    }
                </style>
            </div>
        )
    }
}

export default Test;
